import React, { useState, useEffect } from 'react';

import { MdAdd, MdSearch, MdMoreHoriz, MdEdit, MdDelete } from 'react-icons/md';

import { Container, Title, PageActions, PageContent } from './styles';

import MoreBtn from '../../components/MoreBtn';

import api from '../../services/api';

export default function Deliverys() {
  const [deliveryman, setDeliveryman] = useState([]);
  const [name, setName] = useState('');

  useEffect(() => {
    async function loadDeliveryman() {
      const response = await api.get('/deliveryman', {
        params: {
          name,
        },
      });

      setDeliveryman(response.data);
    }

    loadDeliveryman();
  }, [name]);

  return (
    <>
      <Container>
        <Title>
          <strong>Gerenciando entregadores</strong>
        </Title>

        <PageActions>
          <div>
            <MdSearch size={20} />
            <input type="text" placeholder="Buscar por encomenda" />
          </div>
          <button type="button">
            <MdAdd color="#fff" size={20} />
            <strong>Cadastrar</strong>
          </button>
        </PageActions>

        <PageContent>
          <thead>
            <tr>
              <th>ID</th>
              <th>Foto</th>
              <th>Nome</th>
              <th>Email</th>
              <th>Ações</th>
            </tr>
          </thead>
          <tbody>
            {deliveryman.map(d => (
              <>
                <tr>
                  <td>{d.id}</td>
                  <td>
                    <img
                      src={
                        d.avatar
                          ? d.avatar.url
                          : 'https://api.adorable.io/avatars/abott@adorable.png'
                      }
                      alt={d.avatar}
                    />
                  </td>
                  <td>{d.name}</td>
                  <td>{d.email}</td>
                  <td>
                    <MoreBtn>
                      <button type="button">
                        <MdEdit />
                        Editar
                      </button>
                      <button type="button">
                        <MdDelete />
                        Editar
                      </button>
                    </MoreBtn>
                  </td>
                </tr>
                <br />
              </>
            ))}
          </tbody>
        </PageContent>
      </Container>
    </>
  );
}
